import React from 'react';
import MenuItem from './MenuItem';
const Header = (props) =>{
    return(
        <header className="header-data">
            <ul>
                <li>
                    <a href={props.hlinks}>{props.hname}</a>
                </li>
            </ul>
        </header>
    );
}
export default Header;
